package JavaArrays;

public class L1P4 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int[] randomNum = {10,34,56,45,2,19,26,100,95,91};
		for(int i = 0; i < randomNum.length; i++){
			if(i < 9) {
				System.out.print(randomNum[i] + ",");
			}
			else {
				System.out.print(randomNum[i]);
			}
		}
		
						
	}

}
